import * as React from "react";
import {
  Formik,
  FormikHelpers,
  FormikProps,
  Form,
  Field,
  FieldProps,
} from "formik";

interface MyFormValues {
  firstName: string;
  lastName: string;
  dateOfBirth: Date;
  email: string;
  mobileNumber: string;
  dateOfGraduation: Date;
  employed: Boolean;
  employer: string;
  role: string;
}

const AddForm: React.FC<{}> = () => {
  const initialValues: MyFormValues = {
    firstName: "",
    lastName: "",
    dateOfBirth: "",
    email: "",
    mobileNumber: "07538758805",
    dateOfGraduation: "",
    employed: false,
    employer: "",
    role: "",
  };
  return (
    <div>
      <h1>My Example</h1>
      <Formik
        initialValues={initialValues}
        onSubmit={(values, actions) => {
          console.log({ values, actions });
          alert(JSON.stringify(values, null, 2));
          actions.setSubmitting(false);
        }}
      >
        <Form>
          <label htmlFor="firstName">First Name</label>
          <Field id="firstName" name="firstName" placeholder="First Name" />

          <label htmlFor="lastName">Last Name</label>
          <Field id="lastName" name="lastName" placeholder="Last Name" />

          <label htmlFor="dateOfBirth">Date of Birth</label>
          <Field
            id="dateOfBirth"
            name="dateOfBirth"
            placeholder="Date of Birth"
          />

          <label htmlFor="email">E-mail</label>
          <Field id="email" name="email" placeholder="E-mail" />

          <label htmlFor="mobileNumber">Mobile Number</label>
          <Field
            id="mobileNumber"
            name="mobileNumber"
            placeholder="Your number"
          />

          <label htmlFor="dateOfGraduation">Graduation date</label>
          <Field
            id="dateOfGraduation"
            name="dateOfGraduation"
            placeholder="dateOfGraduation"
          />

          <label htmlFor="employed">Employed</label>
          <Field id="employed" name="employed" placeholder="employed" />

          <button type="submit">Submit</button>
        </Form>
      </Formik>
    </div>
  );
};

export default AddForm;
